urs familles respectives (mme nom, mme adresse).<br><br>  3.2 La participation  Sloto Prizes se fait en se connectant  lApplication. Aucune cration de compte utilisateur nest ncessaire pour participer au jeu.<br><br>  Le participant a la possibilit  tout moment, sil le souhaite, de crer un compte utilisateur sur lApplication en indiquant ses coordonnes, et devra renseigner ses coordonnes personnelles en cas dobtention du Jackpot afin de pouvoir recevoir sa dotation. Il devra donc dans ce cas indiquer :<br><br> sa civilit,<br> son prnom<br> son nom,<br> son adresse lectronique,<br> son adresse postale et ventuellement d\'autres informations afin notamment de pouvoir recevoir ses gains,<br> sa date de naissance,<br> son numro de tlphone.<br><br>  Il appartient  lutilisateur de bien sassurer que ses civilit, prnom, nom, adresse lectronique, adresse postale, date de naissance, numro de tlphone sont renseigns correctement, et que notamment ladresse lectronique fonctionne normalement.<br><br>   Lutilisateur peut utiliser lApplication sans pour autant remplir ses coordonnes personnelles.<br><br> LOrganisateur se rserve le droit :<br><br>  d\'annuler un gain si le gagnant n\'a pas saisi correctement ses coordonnes.<br><br>  LOrganisateur se rserve le droit de supprimer les comptes utilisateurs suivants :<br><br>  les utilisateurs mineurs,<br> les utilisateurs ne stant pas connects  lApplication depuis douze (12) mois.<br><br>  LOrganisateur se rserve le droit de procder  la suppression des comptes concerns sans aucune communication pralable.<br><br>  3.3 Toute participation doit tre loyale<br><br>  Toute personne ne remplissant pas les conditions de participation ci-avant dtailles qui tenterait par quelque moyen que ce soit de jouer sur Sloto Prizes ne pourrait prtendre percevoir quelque gain que ce soit et contreviendrait au prsent rglement.<br><br>    Il est rigoureusement interdit, par quelque moyen que ce soit, de modifier ou de tenter de modifier les dispositifs de jeux proposs, notamment afin d\'en modifier les rsultats ou tout lment dterminant l\'issue d\'une partie ainsi que les gagnants d\'une partie.<br><br>     Il est totalement interdit de jouer avec plusieurs adresses emails relies  une mme personne physique ainsi que de jouer  partir d\'un compte ouvert pour le compte d\'une tierce personne.<br><br>   Les participants qui tenteraient de participer par des moyens tels que des automates de participation automatiss, utilisant des informations (noms, prnoms, adresses lectroniques) ne correspondant pas  leur vritable identit seront automatiquement limins.<br><br>    LOrganisateur se rserve le droit de faire respecter l\'galit de chance entre tous les participants, par tout moyen  sa disposition, y compris par voie judiciaire et notamment de procder  la suppression de comptes et d\'annuler la participation au jeu de toute personne ne respectant pas le prsent rglement ou encore dannuler un gain si le gagnant a tronqu le rsultat dune partie ou ne sest pas conform au prsent rglement.<br><br>  ARTICLE 4 - MODALITS DE PARTICIPATION<br><br>  Il est rappel que le jeu propos par lOrganisateur est un jeu rgit par le hasard.<br><br> Pour participer, lutilisateur devra:<br><br>  1. Tlcharger lApplication<br> 2. Ouvrir lApplication sur son smartphone ou sur sa tablette.<br> 3. Cliquer sur le bouton  Jouer <br><br>  Une partie de machine  sou est offerte toutes les cinq (5) minutes au joueur. Il pourra donc jouer sur une priode de vingt-quatre (24) heures, deux cent quatre-vingt-huit (288) parties. Sil ne joue pas lensemble de ses parties gratuites, il pourra en cumuler un maximum de 20 sur son compte pour une dure indtermine. Toutes les trois (3) parties joues, le participant devra visionner des vidos publicitaires dune dure maximum de cinq (5) minutes pour pouvoir continuer  jouer.<br><br> Par ailleurs, le joueur aura la possibilit dobtenir des parties supplmentaires gratuites en obtenant la combinaison de rang 1 telle que dcrite  larticle 7 du prsent rglement. Le joueur pourra galement obtenir des parties supplmentaires en visionnant des vidos publicitaires, dune dure maximale de cinq (5) minutes, qui lui seront proposes lorsquil a jou toutes ses parties.<br><br>  ARTICLE 5 - CONFIDENTIALIT-SCURIT<br><br>  LApplication ne requrant pas didentification spcifique avec email et mot de passe par exemple, le tlchargement de lApplication sur son smartphone ou sur sa tablette vaut preuve de sa connexion  lApplication.<br> LOrganisateur invite,  cet gard, le participant  tre vigilant, surtout lorsque celui-ci donnerait les codes daccs  son tlphone  des personnes tierces.<br><br> ARTICLE 6 - DSIGNATION DES GAGNANTS<br><br> 6.1 Dsignation des gagnants dans le cadre de la machine  sous LApplication repose sur un principe dinstant gagnant.<br><br> Un instant gagnant est un algorithme informatique (formule mathmatique alatoire de dsignation du gagnant) qui dtermine pour chaque participation valide, si une combinaison est gagnante ou perdante dans la limite des lots disponibles dfinis  larticle 7 du prsent rglement.<br><br> Lalgorithme utilis pour le jeu de machine  sous est dpos auprs de la Selarl Alexandre & associs, huissiers de justice associs, 10, rue du Port, 16100 Cognac.<br><br> Chaque ligne de machine  sous comporte 3 colonnes. Pour gagner, le participant devra obtenir lune des combinaisons dtailles ci-dessous et tel quindiqu sur lApplication<br><br> Jackpot :               Lorsquun cycle est termin, les gains sont rinitialiss.<br><br> Le participant sera inform immdiatement et directement sur lApplication sil a gagn. Sil a remport le Jackpot, le participant pourra galement retrouver son gain dans la rubrique  Gagnants  o figureront son prnom, la premire lettre de son patronyme, son code postal, la dsignation du lot ainsi que la date de gain.<br><br>   6.2 Dsignation des gagnants dans le cadre de la tombola<br><br> Le tirage au sort du(des) gagnant(s) de chaque tombola est ralis de manire automatique et informatique lors de la clture de chacune delles tel quindiqu sur lApplication dans la rubrique  Cadeaux . Un script informatique automatique dtermine parmi lensemble des tickets ayant t changs pour ladite tombola un ou plusieurs tickets dsigns gagnants tel quindiqu sur lApplication dans la rubrique  Cadeaux .<br><br>  Le(s) dtenteur(s) dudit(desdits) ticket(s) gagnant(s) sera(ont) avis(s) par courrier lectronique de son(leur) gain dans un dlai maximal de quinze (15) jours suivant la dsignation du(es) gagnant(s). Il(s) pourra(ont) galement retrouver son(leur) gain dans la rubrique  Gagnants  o figureront son(leur) prnom, la premire lettre de son(leur) patronyme, son(leur) code postal, la dsignation du lot ainsi que la date de gain.<br><br> Les noms et prnoms et le cas chant les photos des gagnants pourront tre diffuss sur la page daccueil de lApplication dans les conditions prvues  larticle 13.4 du prsent rglement.<br><br>  ARTICLE 7 - JEUX ET DOTATIONS<br><br>  L\'attribution des gains s\'effectue sous rserve de respecter le prsent rglement et notamment ses articles 3 et 4 prcits et de justifier de son identit. Lorganisateur se rserve le droit d\'annuler un gain si le gagnant n\'a pas saisi correctement ses coordonnes, sil a visiblement, et par n\'importe quel moyen, russi  tronquer le rsultat d\'une partie ou ne s\'est pas conform au prsent rglement. Les photographies ou reprsentations graphiques prsentant les produits ou services  gagner ont exclusivement une fonction d\'illustration et ne sont pas contractuelles.<br><br>  7.1 Gains obtenus sur la machine  sous<br><br>  Dfinition des symboles utiliss<br><br>  Lensemble des combinaisons gagnantes est dtaill dans la rubrique  Aide  puis  Combinaisons gagnantes . <br><br>  Afin de recevoir le Jackpot ou une dotation issue de la tombola, en cas de gain, le participant devra renseigner ses coordonnes dans la rubrique  Mon profil  et sassurer quelles sont correctes afin que sa dotation puisse lui tre envoye.<br><br> Jackpot : Si le participant dcouvre 3 symboles identiques au symbole Jackpot, il remporte la somme telle que diffuse sur lApplication dans la case Jackpot. Il y a un lot de rang 1 sur un cycle de 10000001 de parties de machine  sous. Cette somme est susceptible dvolution chaque jour et est visible de faon permanente et actualise en temps rel sur lApplication dans la case Jackpot au-dessus de la machine  sous.<br><br> Lot de rang 1 : Si le participant dcouvre la combinaison identique au lot de rang 1, il remporte 10 parties supplmentaires pour la machine  sous. Il y a 400000 lots de rang 1 sur un cycle de 10000001 de parties de machine  sous.<br><br> Lot de rang 2 : Si le participant dcouvre la combinaison identique au lot de rang 2, il remporte 5 tickets de participation  la tombola. Il y a 200000 lots de rang 2 sur un cycle de 10000001 de parties de machine  sous.<br><br> Lot de rang 3 : Si le participant dcouvre une combinaison identique  lune des combinaisons de lot de rang 3, il remporte le nombre de jetons correspondant  la combinaison tel quindiqu sur lApplication. Il pourra changer ces jetons conte des tickets de tombola dans la rubrique Obtenez des tickets. Il y a 7400000 lots de rang 3 sur un cycle de 10000001 de parties de machine  sous. Chaque ticket de tombola quivaut  1000 jetons. Le reste des combinaisons disponibles pour complter le cycle, soit 2000000 de combinaisons, sont des combinaisons perdantes.<br><br> 7.2 Dotations obtenues  la tombola<br><br>  En remportant les lots des rangs 2 et 3, prcdemment dfinis  larticle 7.1, le gagnant pourra les utiliser pour participer aux tombolas disponibles dans la rubrique Cadeaux.<br><br>  Sur cette page sont listes lensemble des dotations disponibles et quil est possible de remporter  la tombola. Pour chaque dotation sont indiques les informations suivantes :<br><br>  Dsignation du/des lot(s)<br> Le nombre de tickets de tombola ncessaires pour obtenir une participation.<br> Le temps restant avant le tirage au sort qui dsignera le(s) gagnant(s) de la dotation.<br>  Il est possible dobtenir plus dinformations concernant les lots mis en jeu en cliquant sur le bouton  Participer .<br><br>  La liste des tombolas est volutive et actualise plusieurs fois par mois. Il convient aux joueurs de se rendre rgulirement sur la rubrique Cadeaux pour consulter la liste des dotations actualise.<br><br>  ARTICLE 8 - ENVOI DES DOTATIONS<br><br>  8.1 Le gagnant pourra tre amen  fournir une preuve d\'identit en envoyant la photocopie dune pice didentit officielle, sur demande de lOrganisateur ainsi qu\'un justificatif de domicile  son nom (facture d\'lectricit ou facture tlphonique par exemple).<br><br>  Dans certains cas, un numro de tlphone pourra tre exig afin de pouvoir prendre rendez-vous pour la livraison de la dotation.<br><br>  Le participant devra alors renseigner ce numro dans la partie  Mon Compte  de lApplication dans un dlai maximal de 30 jours  compter de la confirmation par courrier lectronique de son gain, adresse par lOrganisateur.<br><br>  Les gains sont nominatifs et ne peuvent tre transmis  des tiers.<br><br>  8.2 LOrganisateur ou ses partenaires adresseront aux gagnants leurs prix sous un dlai maximum de 90 jours  compter du rsultat de la partie.<br><br> Jackpot obtenu sur la machine  sous : lOrganisateur tablira et adressera  ladresse postale du gagnant un chque bancaire ou un virement bancaire du montant correspondant au lot dfini pour le Jackpot en question  la date du gain tel quindiqu sur lApplication.<br><br> Lots de rang 1 de la machine  sous : lOrganisateur incrmentera automatiquement et immdiatement le compteur de parties de machines  sous disponible sur le compte du joueur ds la validation de la combinaison.<br><br> Lots de rang 2 de la machine  sous : lOrganisateur incrmentera automatiquement et immdiatement le compteur de tickets de participation  la tombola disponible sur le compte du joueur ds la validation de la combinaison.<br><br> Lots de rang 3 de la machine  sous : lOrganisateur incrmentera automatiquement et immdiatement le compteur de jetons disponible sur le compte du joueur ds la validation de la combinaison.<br><br> Lot obtenu  la tombola : lOrganisateur adressera, par voie postale, dans le cas dun cadeau physique, le lot correspondant  la tombola remporte, ou par voie lectronique, dans le cas dun lot lectronique, un code personnel  lintention du gagnant qui lui permettra dutiliser son chque cadeau et de rgler ainsi tout ou partie dune commande sur le site internet sur lequel il peut tre utilis. Les conditions dutilisation des lots lectroniques sont indiques lors de lenvoi de ces derniers de sorte que lutilisateur sengage  sy conformer sans rserve.<br><br>  8.3 Dans le cas o lOrganisateur adresserait les dotations remportes  des coordonnes inexactes ou incompltes, le participant ne pourrait exiger le renvoi de son gain et perdrait la proprit de ce dernier.<br><br>    Il est de la responsabilit du membre de fournir des informations exactes et valides et de vrifier qu\'elles sont toujours valides au moment de son gain.<br><br>    La responsabilit de lOrganisateur ne pourrait tre engage dans le cas o l\'inexcution ou la mauvaise excution d\'un envoi serait imputable soit au Participant, soit au fait imprvisible et insurmontable d\'un tiers soit  un cas de force majeure.<br><br>  ARTICLE 9 - ACCEPTATION<br><br>  La participation au jeu implique la pleine et entire acceptation du prsent rglement.<br><br>  Le rglement peut tre consult en ligne sur lApplication dans la rubrique  Aide .<br><br>    ARTICLE 10  RESPONSABILIT<br><br>  LOrganisateur ne pourra tre tenu responsable si, pour une raison indpendante de sa volont, ce jeu venait  tre modifi, report ou annul.<br><br>    LOrganisateur ne pourra tre tenu responsable si le store  partir duquel le jeu est accessible tait momentanment indisponible.<br><br>  ARTICLE 11 - PROPRIT INTELLECTUELLE<br><br>  LApplication Sloto Prizes est une uvre protge au sens du Code de la