llecte loyale et licite des donnes  caractre personnel ;<br><br> Ne pas collecter de donnes dites  sensibles  au sens de la Loi Informatique et Liberts telles que les donnes relatives aux origines raciales,  la religion, aux murs, aux infractions, aux condamnations ;<br><br> Conserver les donnes  caractre personnel uniquement le temps ncessaire  laccomplissement de lobjectif qui tait poursuivi lors de leur collecte ;<br><br> A prendre toutes prcautions utiles afin de prserver la scurit et la confidentialit des donnes  caractre personnel quil traite et notamment dempcher quelles ne soient dformes, endommages ou communiques  des tiers non autoriss ;<br><br> A effectuer sous sa propre responsabilit les dclarations et/ou les demandes dautorisation auprs de la CNIL ;<br><br> Respecter les droits des personnes (droit dinformation, daccs, de rectification ou dopposition).<br><br>  12.2 Collecte de donnes  caractre personnel<br><br>    La notion de Donnes  caractre personnel dsigne toute information relative  une personne physique identifie ou identifiable.<br><br>  LOrganisateur est amen  collecter et traiter les donnes  caractre personnel suivantes :<br><br>  les prnom, nom dutilisateur, adresse email, la civilit, la date de naissance, le code postal, le numro de tlphone, ladresse, les donnes de localisation, le numro didentifiant du terminal et toute autre donne qui pourrait figurer sur le formulaire dinscription, dans le respect des principes de pertinence et de proportionnalit.<br><br> 12.3 Finalits des traitements de donnes personnelles et bases lgales<br><br>  Vos donnes sont traites par lOrganisateur pour vous permettre de bnficier des services proposs comme par exemple :<br><br> Crer votre Compte personnel<br> Dterminer le ou la gagnante<br> Attribuer et acheminer le ou les lots<br> Diffuser la liste des gagnants<br>  Le fondement lgal de ces traitements est lexcution dun contrat ou lintrt lgitime.<br><br>  En cas dacceptation expresse de votre part, vos donnes pou