ment UE 2016/679 du Parlement europen et du Conseil du 27 avril 2016 relatif  la protection des personnes physiques  l\'gard du traitement des donnes  caractre personnel et  la libre circulation de ces donnes (rglement gnral sur la protection des donnes), applicable  compter de cette date.<br><br>   12.5 Droit des personnes daccs, de rectification et dopposition pour motifs lgitimes<br><br>    Vous disposez dun droit daccs, de rectification, deffacement et  la portabilit des donnes vous concernant. Vous pouvez galement demander la limitation du traitement des donnes vous concernant ou vous opposer  ce traitement. Vous tes en droit de communiquer  lOrganisateur vos directives relatives au sort des Donnes personnelles vous concernant en cas de dcs.<br><br>  Nous nous rservons le droit dexiger le paiement de  frais raisonnables  lis aux cots administratifs supports pour fournir les informations si votre demande est manifestement infonde ou excessive. Nous nous efforcerons de rpondre  vos demandes dans les dlais requis par le RGPD.<br><br>  Afin de protger votre vie prive et d\'assurer votre scurit, nous prendrons galement des mesures raisonnables pour vrifier votre identit avant de vous donner accs  vos informations personnelles ou de corriger, modifier ou supprimer vos donnes. Toute demande pourra tre accompagne dune copie de votre carte didentit.<br><br> Pour exercer vos droits, veuillez contacter lOrganisateur via ladresse postale suivante : Tagada Games 55, rue Legendre 75017 Paris.<br><br>  En cas de non-respect de vos droits, vous pouvez introduire une rclamation auprs de la CNIL.<br><br>  12.6 Diffusion du nom des gagnants<br><br>    En acceptant le prsent rglement des jeux, chaque participant ayant obtenu un lot autorise lOrganisateur  utiliser son prnom et l\'initiale de son nom ainsi que son code postal, sans que cela lui confre une rmunration, un droit ou un avantage quelconque autre que l\'attribution de son lot.<br><br>     Aprs acceptation pralable et expresse du participant ayant obtenu un lot, lOrganisateur pourra galement utiliser la photo communique par ce dernier afin de la diffuser sur lApplication et sur l\'ensemble de ses promotions.<br><br>    Lutilisation de ces donnes personnelles a pour unique objet de rendre public lidentit du gagnant pendant une priode qui ne saurait dpasser 24 mois.<br><br>  12.7 Dure de conservation<br><br>  Vos informations personnelles seront conserves sous une forme identifiable que pendant le temps ncessaire aux oprations pour lesquelles elles ont t collectes et dans le respect de la rglementation en vigueur.<br><br>  Les Donnes personnelles recueillies pour participer au jeu seront conserves pendant toute la dure du jeu et aprs lexpiration de cette opration, pour la dure ncessaire  la dsignation du gagnant,  la gestion des lots et des ventuelles rclamations, soit une dure totale maximale de trois ans. Au terme de cette priode, les donnes sont dtruites conformment aux mesures prescrites par la lgislation en vigueur.<br><br>  Les donnes permettant de retracer le recueil de votre consentement sont conserves par lOrganisateur pendant une dure maximum de 5 ans afin dtre en mesure, le cas chant, dapporter la preuve de votre consentement.<br><br>  Vos donnes sont supprimes sans dlai en cas de dcs connu par lOrganisateur.<br><br>  Certaines donnes pourront tre conserves pour une dure supplmentaire pour la gestion de rclamations et/ou contentieux ainsi que pour rpondre  nos obligations lgales ou rglementaires ou encore pour rpondre  des demandes dautorits habilites.<br><br>  ARTICLE 13  COOKIES  Dans le cadre de lApplication, nous utilisons des cookies. Il sagit de petits fichiers texte dposs sur votre disque dur par le site internet visit, lui permettant denregistrer et de stocker certaines informations de votre ordinateur mais aussi sur vous.<br><br>  Pour toute information complmentaire, veuillez consulter notre Politique de Cookies.<br><br>  ARTICLE 14 - RCLAMATION  DROIT APPLICABLE<br><br>  Toute rclamation ou contestation relative au jeu ou au rglement devra obligatoirement parvenir par crit  lOrganisateur.<br><br>   Le prsent rglement est soumis au droit franais.<br><br>   En cas de litige, les juridictions franaises seront seules comptentes.<br><br> '),(7,'faq',NULL,1,'How many programmers does it take to change a light bulb?\nNone  Its a hardware problem'),(8,'faq',NULL,2,' Qu es un terapeuta?  1024 Gigapeutas.'),(9,'faq',NULL,8,'<b>Fonctionnement de Sloto Prizes</b><br><br> <b>Le jeu est-il totalement gratuit ?</b><br><br> Oui. Sloto Prizes est un jeu 100% gratuit sans obligation d\'achat. Lapp est finance exclusivement par les annonceurs.<br> Pour plus de dtails, vous pouvez consulter notre rglement.<br><br> <b>Comment jouer et gagner sur Sloto Prizes ?</b><br><br> Sloto Prizes repose sur un principe dinstant gagnant. En jouant que Sloto Prizes, vous pouvez gagner des jetons, des parties, et du cash !<br><br> Une fois lapp installe, vous pouvez commencer directement  jouer. Il vous suffit de lancer la slot machine en cliquant sur le bouton  jouer <br><br> Vous saurez instantanment si vous avez gagn ou perdu. La liste des combinaisons gagnantes est disponible dans la rubrique Aide du site. <br><br> <b>Qui peut jouer  Sloto Prizes ?</b><br><br> Toute personne majeure peut jouer  Sloto Prizes<br><br> <b>Combien de parties peut-ont jouer quotidiennement ?</b><br><br> Les parties se rechargent plusieurs fois par jour.<br><br> Vous pouvez galement obtenir plus de parties en vous rendant dans la rubrique Bonus. Suivez les instructions pour obtenir vos parties.<br><br> <b>Fonctionnement de la tombola</b><br><br> <b>Qu\'est-ce que la tombola ?</b><br><br> La tombola repose sur un principe de tirage au sort. Chaque participant peut miser autant de tickets qu\'il le souhaite, en fonction du nombre de tickets dont il dispose, sur le ou les cadeau(x) proposs dans la rubrique Cadeaux. Chaque tombola est dfinie sur une priode de temps limite.  la fin de ladite priode, un tirage au sort dterminant le gagnant est effectu de manire informatique et automatique. Le gagnant reoit une notification l\'informant de son gain.<br><br> <b>Comment gagner des tickets de tombola ?</b><br><br> Vous pouvez gagner des tickets de tombola en actionnant la machine  sous ou en changeant vos jetons contre des tickets de tombola.<br><br> <b>Comment jouer  la tombola ?</b><br><br> Pour jouer  la tombola, rendez vous dans la rubrique Cadeaux. Choisissez le ou les cadeau(x) qui vous intresse(nt). Pour participer, vous devez miser au minimum le nombre de tickets indiqu sur chaque lot. Chaque participation vous donne une chance de gagner. Vous pouvez acqurir autant de participations que vous le souhaitez tant que vous avez suffisamment de tickets de tombola.<br><br> <b>Qui sommes nous ?</b><br><br> Sloto Prizes, est une app dite par la socit Tagada Games - Socit par actions simplifie au capital de 1.000 Euros dont le sige social est situ : 55 rue Legendre 75017 Paris, France.<br><br> <b>Informations personnelles</b><br><br> <b>Comment modifier mes informations personnelles ?</b><br><br> Rendez vous dans la rubrique Mon compte. Vous pourrez modifier vos donnes personnelles.<br><br> <b>Vous n\'avez pas trouv de rponse adapte</b><br><br> Si vous rencontrez un problme et que la rponse  votre question n\'apparat pas ci-dessus ou dans le rglement du jeu, n\'hsitez pas  nous contacter en utilisant la rubrique Contact en bas de chaque page.<br><br>'),(10,'privacyPolicy',NULL,1,'Why do programmers always mix up Halloween and Christmas?\nBecause Oct 31 equals Dec 25'),(11,'privacyPolicy',NULL,2,'Cuando escrib este cdigo solo Dios y yo sabamos, ahora solo Dios sabe'),(12,'privacyPolicy',NULL,8,'<b>Politique de Protection des Donnes Personnelles</b><br><br>   La prsente Politique de Protection des Donnes Personnelles a pour objectif de vous informer du traitement de vos donnes personnelles lors de votre navigation sur le lapplication mobile  Sloto Prize