amentaux des personnes.<br><br>  En cas de transfert de vos donnes aux tats-Unis, TAGADA GAMES sengage  vrifier si lentit destinataire desdites donnes a adhr au  Privacy Shield , mcanisme dauto-certification pour les entreprises tablies aux tats-Unis. Ce mcanisme a t reconnu par la Commission europenne comme offrant un niveau de protection adquat aux donnes  caractre personnel transfres par une entit europenne vers des entreprises tablies aux tats-Unis.<br><br>  <b>Article 6 - Dsignation dun Dlgu  la protection des donnes </b><br><br>  TAGADA GAMES a dsign un Dlgu  la Protection des Donnes ( <b>DPO</b> ) en charge du respect de la rglementation relative  la protection des donnes personnelles dont les coordonnes apparaissent ci-dessous :<br><br>  TAGADA GAMES<br> DPO<br> 55, rue Legendre 75017 Paris<br> dpo@tagadagames.com<br>  <b>Article 7 - Droits des personnes</b><br><br>  Vous disposez dun droit daccs, de rectification, deffacement et  la portabilit des donnes vous concernant. Vous pouvez galement demander la limitation du traitement des donnes vous concernant ou vous opposer  ce traitement. Vous tes en droit de communiquer  TAGADA GAMES vos directives relatives au sort des donnes personnelles vous concernant en cas de dcs.<br><br>  Vos droits peuvent tre exercs auprs du Dlgu  la Protection des Donnes de TAGADA GAMES dont les coordonnes sont indiques au sein de la prsente Politique.<br><br>  Nous nous rservons le droit dexiger le paiement de  frais raisonnables  lis aux cots administratifs supports pour fournir les informations si votre demande est manifestement infonde ou excessive. Nous nous efforcerons de rpondre  vos demandes dans les dlais requis par le RGPD.<br><br>  Afin de protger votre vie prive et d\'assurer votre scurit, nous prendrons galement des mesures raisonnables pour vrifier votre identit avant de vous donner accs  vos informations personnelles ou de corriger, modifier ou supprimer vos abonnements. Toute demande pourra tre accompagne dune copie de votre carte didentit.<br><br>En cas de non-respect de vos droits, vous pouvez introduire une rclamation auprs de la CNIL.<br><br>   <b>Article 8 - Scurit et confidentialit des donnes</b><br><br>  Nous mettons en uvre des mesures organisationnelles et techniques de scurit destines  garantir la confidentialit et lintgrit de vos donnes  caractre personnel. A ce titre, les prcautions administratives, organisationnelles, techniques et physiques ont pour but de protger vos donnes  caractre personnel de la perte, du vol, de labus dutilisation, dun accs non autoris, de transmission non autorise, de toute modification ou destruction indue.<br><br>  Dans tous les cas, le responsable de traitement prendra les mesures de scurit adaptes  la nature des donnes collectes.<br><br>  Les donnes collectes sont stockes de manire confidentielle et protges  un haut niveau de scurit. Les serveurs o sont stockes ces donnes sont conformes aux normes de scurit actuellement en vigueur. Ils sont protgs contre des attaques numriques et des attaques physiques.<br> Toutes les pages du Site sur lesquelles vous tes amens  communiquer des donnes personnelles sont scurises.<br><br>  Toutefois, malgr tous nos efforts, nous ne pouvons pas garantir linfaillibilit de cette protection en raison de risques invitables pouvant survenir lors de la transmission de donnes personnelles.<br><br>  <b>Article 9 - Dure de conservation des Donnes  caractre personnel</b><br><br>TAGADA GAMES ne conserve vos Donnes  caractre personnel que pendant le temps ncessaire aux oprations pour lesquelles elles ont t collectes et dans le respect de la rglementation en vigueur.<br><br>  Dune manire gnrale, vos Donnes  caractre personnel sont conserves tant que votre Compte personnel reste actif puis font lobjet dun archivage afin de rpondre aux obligations lgales ou  des fins probatoires ou sont anonymises  des fins dtudes et statistiques.<br><br>  Vos Donnes personnelles collectes pour vous envoyer des newsletters/offres commerciales seront utilises par TAGADA GAMES  cette fin jusquau retrait du consentement et au plus tard pendant une dure de trois ans  compter de la date du recueil de votre consentement.<br><br>  Les donnes permettant de retracer le recueil de votre consentement sont conserves par TAGADA GAMES pendant une dure de 5 ans afin dtre en mesure, le cas chant, dapporter la preuve de votre consentement.<br><br> Les donnes sont supprimes sans dlai lorsque TAGADA GAMES prend connaissance du dcs de la personne.<br><br>  Certaines donnes pourront tre conserves pour une dure supplmentaire pour la gestion de rclamations et/ou contentieux ainsi que pour rpondre  nos obligations lgales ou rglementaires ou encore pour rpondre  des demandes dautorits habilites.<br><br><b>Article 10 - Liens vers des sites externes</b><br><br>  Il est prcis que certains liens sur lApp permettent daccder  des sites externes (i-frame, bannires, etc) et vous donnent accs  des services tiers (comme les rseau sociaux). <br><br> La prsente Politique ne concerne que les informations collectes sur le Site.  ce titre, TAGADA GAMES ne saurait tre responsable de lutilisation de vos Donnes sur ces autres sites.<br><br>  <b>10.1 Affichage publicitaire :</b><br><br>  Certains traitements utiles pour les affichages publicitaires sur lApp sont mis en uvre en tout ou partie par des tiers partenaires (par exemple des publicits ou des liens sponsoriss). Ceux-ci sont responsables des technologies utilises aux fins de permettre la collecte de donnes (comme des identifiants contenus dans les cookies associs aux pages visites),  des fins de ciblage publicitaire, y compris sur dautres sites.<br> Nous vous invitons  vous reporter sur ce point  notre <b>Politique de Cookies.</b>  <b>10.2 Lien vers dautre site</b><br><br>LApp peut par ailleurs contenir des liens vers dautres sites ou des services proposs par des tiers.<br><br> <b>10.3 Responsabilit</b><br><br>  Nous navons pas de contrle sur la manire dont les sites et services tiers